import React, { useState } from 'react';
import {
    Box,
    Paper,
    Typography,
    TextField,
    Button,
    styled,
    Alert,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../../utils/supabaseClient';

const RegisterWrapper = styled(Box)({
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    background: '#f8f9fa',
    padding: '20px',
});

const RegisterBox = styled(Paper)({
    width: '100%',
    maxWidth: '400px',
    padding: '40px',
});

const StyledTextField = styled(TextField)({
    marginBottom: '16px',
    '& .MuiInputBase-input': {
        padding: '12px',
    },
});

const RequiredLabel = styled('span')({
    color: '#ff0000',
    marginLeft: '4px',
});

export default function Register() {
    const navigate = useNavigate();
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [formData, setFormData] = useState({
        name_kana: '',
        user_id: '',
        email: '',
        password: '',
        confirmPassword: '',
        referral_id: '',
        usdt_address: '',
        wallet_type: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const validateForm = () => {
        if (!formData.name_kana.match(/^[ァ-ヶー]+$/)) {
            throw new Error('名前は全角カタカナで入力してください');
        }
        if (!formData.email.match(/^[^\s@]+@[^\s@]+\.[^\s@]+$/)) {
            throw new Error('有効なメールアドレスを入力してください');
        }
        if (formData.password !== formData.confirmPassword) {
            throw new Error('パスワードが一致しません');
        }
        if (formData.password.length < 6) {
            throw new Error('パスワードは6文字以上で入力してください');
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            validateForm();

            // Supabase Auth での登録
            const { data: authData, error: authError } = await supabase.auth.signUp({
                email: formData.email,
                password: formData.password,
            });

            if (authError) throw authError;

            // プロフィールの作成
            const { error: profileError } = await supabase
                .from('profiles')
                .insert([
                    {
                        id: authData.user.id,
                        name_kana: formData.name_kana,
                        user_id: formData.user_id,
                        email: formData.email,
                        referral_id: formData.referral_id,
                        usdt_address: formData.usdt_address,
                        wallet_type: formData.wallet_type,
                    },
                ]);

            if (profileError) throw profileError;

            navigate('/');
        } catch (error) {
            setError(error.message);
        } finally {
            setLoading(false);
        }
    };

    return (
        <RegisterWrapper>
            <RegisterBox>
                <Typography variant="h5" gutterBottom sx={{ textAlign: 'center', mb: 4 }}>
                    新規ユーザー登録
                </Typography>

                {error && (
                    <Alert severity="error" sx={{ mb: 2 }}>
                        {error}
                    </Alert>
                )}

                <Box component="form" onSubmit={handleSubmit}>
                    <StyledTextField
                        fullWidth
                        label="名前（カタカナ）"
                        name="name_kana"
                        required
                        value={formData.name_kana}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>名前（カタカナ）<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="ユーザーID"
                        name="user_id"
                        required
                        value={formData.user_id}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>ユーザーID<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="メールアドレス"
                        name="email"
                        type="email"
                        required
                        value={formData.email}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>メールアドレス<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="パスワード"
                        name="password"
                        type="password"
                        required
                        value={formData.password}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>パスワード<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="パスワード（確認）"
                        name="confirmPassword"
                        type="password"
                        required
                        value={formData.confirmPassword}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>パスワード（確認）<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="紹介者ID"
                        name="referral_id"
                        required
                        value={formData.referral_id}
                        onChange={handleChange}
                        disabled={loading}
                        InputLabelProps={{
                            children: (<>紹介者ID<RequiredLabel>*</RequiredLabel></>)
                        }}
                    />

                    <StyledTextField
                        fullWidth
                        label="USDTアドレス（BEP20）"
                        name="usdt_address"
                        value={formData.usdt_address}
                        onChange={handleChange}
                        disabled={loading}
                    />

                    <StyledTextField
                        fullWidth
                        label="ウォレットタイプ"
                        name="wallet_type"
                        value={formData.wallet_type}
                        onChange={handleChange}
                        disabled={loading}
                    />

                    <Button
                        fullWidth
                        type="submit"
                        variant="contained"
                        disabled={loading}
                        sx={{ mb: 2 }}
                    >
                        登録
                    </Button>

                    <Button
                        fullWidth
                        onClick={() => navigate('/')}
                        variant="text"
                    >
                        すでにアカウントをお持ちの方
                    </Button>
                </Box>

                <Typography
                    variant="caption"
                    sx={{
                        display: 'block',
                        textAlign: 'center',
                        mt: 2,
                        color: 'red'
                    }}
                >
                    * は必須項目です
                </Typography>
            </RegisterBox>
        </RegisterWrapper>
    );
}
